<?php $__env->startSection('content'); ?><p>An aerial search is under way for five people missing east of Alice Springs.</p>

<p>The group failed to meet up with friends at a campground at Ruby Gap, 150 kilometres east of the town, over the weekend.</p>

<p>Gabrielle Freedman, 29, Shaygun Narula, 27, Haydn Dodds, 29, Renae Walker, 31 and Jessica Kolic, 29, left Alice Springs in a white Toyota Hilux with NT registration 653414 about 5pm on Saturday.</p>

<p>An aerial search is underway for five missing doctors after the group failed to meet up with friends at a campground at Ruby Gap (pictured), 150 kilometres east of Alice Springs, over the weekend</p>

<p>An aerial search of the Ross Highway, Stuart Highway and Binns Track began at first light on Monday.</p>

<p>Police hold concerns for the welfare of the group as it's unknown what provisions they have with them.</p>

<p>The site is only accessible via a notoriously difficult four-wheel drive track.  </p>

